import React from "react";
import "./PhotoGrid.css";

const PhotoGrid = ({ photos }) => {
    const { links, urls, alt_description } = photos;
    return (
        <div className="photo-grid">
            <a href={links.html}>
                <img src={urls.regular} alt={alt_description} />
            </a>
        </div>
    );
};

export default PhotoGrid;
